import React from "react";
import produtos from "../../Data/produtos";

export default props => {
    const lis = produtos.map((produto) => {
        return (
            <li key={produto.id} >
                {produto.id}) {produto.nome} -> {produto.preço}
            </li>
        );
    });
    return(
        <div>
            <ul style={{listStyle:"none"}} >
                {lis}
            </ul>
        </div>
    )
}
